window["Brick"] = function(renderableObj) {
    GameObject.call(this, renderableObj);
    this.mCircleBound = false;
    this.mCollidableFlag = true;
    this.mCollisionPixelFlag = false;
    this.mDestroy = false;
}
gEngine.Core.inheritPrototype(window["Brick"], window["GameObject"]);

Brick.prototype.update = function() {
    GameObject.prototype.update.call(this);
};

Brick.prototype.draw = function(aCamera) {
    GameObject.prototype.draw.call(this, aCamera);
};

Brick.prototype.onCollisionStay = function(otherObj) {

};

Brick.prototype.onCollisionEnter = function(otherObj) {
    if (otherObj instanceof Ball) {
        this.mDestroy = true;
    }
};

Brick.prototype.onCollisionExit = function(otherObj) {

};
